import React, { useState } from "react";
import { Form, Button, Col, Row } from "react-bootstrap";
import axios from "axios";
import "./Intake.css";

function WasteIntake() {
  const [newIntake, setNewIntake] = useState({
    farmerId: "", // Added farmerId
    farmerName: "",
    place: "",
    weight: "",
    price: "",
    totalPrice: 0,
    collectedBy: "",
    collectedDate: ""
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    let updatedValue = value;

    if (name === "weight" || name === "price") {
      updatedValue = value === "" ? "" : parseFloat(value);
    }

    const updatedIntake = {
      ...newIntake,
      [name]: updatedValue,
    };

    if (updatedIntake.weight && updatedIntake.price) {
      updatedIntake.totalPrice = updatedIntake.weight * updatedIntake.price;
    }

    setNewIntake(updatedIntake);
  };

  const handleFormSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("/api/intakes", newIntake);
      alert("Intake added successfully!");
      setNewIntake({ farmerId: "", farmerName: "", place: "", weight: "", price: "", totalPrice: 0, collectedBy: "", collectedDate: "" });
    } catch (error) {
      console.error("Error adding new intake:", error);
    }
  };

  return (
    <div className="container">
      <div className="waste-container">
        <h1 className="page-title">Waste Intake Management</h1>
        <p className="page-description">Record new waste intake details efficiently and professionally.</p>

        <div className="form-section">
          <h3>Add New Intake</h3>
          <Form onSubmit={handleFormSubmit}>
            <Row className="mb-3">
              <Col md={4}>
                <Form.Control
                  type="text"
                  name="farmerId" // Added name for farmerId
                  value={newIntake.farmerId}
                  onChange={handleInputChange}
                  placeholder="Farmer ID"
                  required
                />
              </Col>
              <Col md={4}>
                <Form.Control
                  type="text"
                  name="farmerName"
                  value={newIntake.farmerName}
                  onChange={handleInputChange}
                  placeholder="Farmer Name"
                  required
                />
              </Col>
              <Col md={4}>
                <Form.Control
                  type="text"
                  name="place"
                  value={newIntake.place}
                  onChange={handleInputChange}
                  placeholder="Place"
                  required
                />
              </Col>
              <Col md={4}>
                <Form.Control
                  type="text"
                  name="collectedBy"
                  value={newIntake.collectedBy}
                  onChange={handleInputChange}
                  placeholder="Collected By (Employee Name)"
                  required
                />
              </Col>
            </Row>
            <Row className="mb-3">
              <Col md={4}>
                <Form.Control
                  type="number"
                  name="weight"
                  value={newIntake.weight}
                  onChange={handleInputChange}
                  placeholder="Weight (tons)"
                  required
                />
              </Col>
              <Col md={4}>
                <Form.Control
                  type="number"
                  name="price"
                  value={newIntake.price}
                  onChange={handleInputChange}
                  placeholder="Price per Ton"
                  required
                />
              </Col>
              <Col md={4}>
                <Form.Control
                  type="text"
                  value={newIntake.totalPrice ? `Total Price: ${newIntake.totalPrice}` : "Total Price: 0"}
                  readOnly
                />
              </Col>
            </Row>
            <Row className="mb-3">
              <Col md={4}>
                <Form.Control
                  type="date"
                  name="collectedDate"
                  value={newIntake.collectedDate}
                  onChange={handleInputChange}
                  placeholder="Collected Date"
                  required
                />
              </Col>
            </Row>
            <Button className="submit-button mt-3" type="submit">Add Intake</Button>
          </Form>
        </div>
      </div>
    </div>
  );
}

export default WasteIntake;
